/**
 * Centauri Core
 * 
 * Function which will be called when Centauri.load() has been called.
 * Registers core functions e.g. Env, Versions etc.
 */
function Centauri_loadFunctions() {
    /**
     * @function isDev - Handles if the environment is on Development
     * @return {boolean}
     */
    Centauri.isDev = function() {
        return (Centauri.Env == "Dev" || Centauri.Env == "Development");
    };
    /**
     * @function isDevelopment - Handles if the environment is on Development
     * @return {boolean}
     */
    Centauri.isDevelopment = function() {
        return (Centauri.Env == "Dev" || Centauri.Env == "Development");
    };

    /**
     * @function isProd - Handles if the environment is on Production
     * @return {boolean}
     */
    Centauri.isProd = function() {
        return (Centauri.Env == "Prod" || Centauri.Env == "Production");
    };
    /**
     * @function isProduction - Handles if the environment is on Production
     * @return {boolean}
     */
    Centauri.isProduction = function() {
        return (Centauri.Env == "Prod" || Centauri.Env == "Production");
    };


    /**
     * @function isUndefined - Handles conditions for variable if it's undefined
     * @param {mixin} variable - the variable of this function
     * @return {boolean}
     */
    Centauri.isUndefined = function(variable) {
        return (typeof variable == undefined || typeof variable == "undefined");
    };
    /**
     * @function isNotUndefined - Handles conditions for variable if it's not undefined
     * @param {mixin} variable - the variable of this function
     * @return {boolean}
     */
    Centauri.isNotUndefined = function(variable) {
        return (typeof variable != undefined && typeof variable != "undefined");
    };

    /**
     * @function isNull - Handles conditions for variable if it's null
     * @param {mixin} variable - the variable of this function
     * @return {boolean}
     */
    Centauri.isNull = function(variable) {
        return (typeof variable === null);
    };
    /**
     * @function isNotNull - Handles conditions for variable if it's not null
     * @param {mixin} variable - the variable of this function
     * @return {boolean}
     */
    Centauri.isNotNull = function(variable) {
        return (typeof variable !== null);
    };

    /**
     * @function elExists - Checks if a given element (by selector) exists or not
     * @param {element} selector - the selector for this function
     * @return {boolean}
     */
    Centauri.elExists = function(selector) {
        return ($(selector).length === 1 ? true : false);
    };

    /**
     * @function stringContains - Checks if a string contains a specific (given) char
     * @param {string} string
     * @param {string} char
     * @return {boolean}
     */
    Centauri.stringContains = function(string, char) {
        var parameter = "";

        if(Centauri.isUndefined(string)) {
            parameter = "string";
        }
        if(Centauri.isUndefined(char)) {
            parameter = "char";
        }

        if(parameter != "") {
            console.error("Centauri-Core: stringContains(string, char) can't be called without a " + parameter + "-parameter!");
            return;
        }

        return (~string.indexOf(char));
    };
}

const Centauri = {};



/**
 * Centauri Environment
 */
Centauri.Env = "Development";

/**
 * Centauri Module - ID
 * Default one when logging into the backend
 */
Centauri.defaultModule = "dashboard";


/**
 * Centauri Core
 */
Centauri.Module = Centauri.defaultModule;

Centauri.fn = {};
Centauri.Helper = {};
Centauri.Events = {};
Centauri.Listeners = {};
Centauri.Components = {};
Centauri.Utility = {};
Centauri.Modal = {};
Centauri.View = {};


/**
 * Centauri Core registrations
 */
Centauri.load = function() {
    Centauri_loadFunctions();

    if(Centauri.isNotUndefined(CentauriEnv)) {
        CentauriEnv();
    }

    Centauri.Utility.Ajax();

    Centauri.DAPLoader();

    Centauri.View.LoginView();

    Centauri.Components.ModulesComponent({type: "init"});
    Centauri.Components.EditorComponent.init();
};


/**
 * DOM ready - loading Centauri
 */
$(document).ready(function() {
    Centauri.load();
});

Centauri.Components.EditorComponent = function(type, data) {
    $editor = $("#editor");

    if(type == "show") {
        Centauri.Components.EditorComponent.FormData = null;
        Centauri.Components.EditorComponent.ButtonsInitialized = false;

        if(Centauri.isNotUndefined(data.size)) {
            $editor.addClass(data.size);
            Centauri.Components.EditorComponent.Size = data.size;
        }

        var crtID   = $editor.attr("data-id");
        var id      = data.id,
            title   = data.title;

        $(".top > p", $editor).html(title);

        if(crtID != id) {
            $editor.attr("data-id", id);

            $("form", $editor).empty();
            // if(Centauri.isUndefined(data.container)) {
                $(".bottom > .container", $editor).remove();
            // }

            if(Centauri.isNotUndefined(data.form)) {
                Centauri.Components.EditorComponent.FormData = data.form;

                if(Centauri.isNotUndefined(data.callbacks.afterFormInitialized)) {
                    data.callbacks.afterFormInitialized($editor);
                }

                $.each(Centauri.Components.EditorComponent.FormData, function(index, inputObj) {
                    if(Centauri.isNotUndefined(inputObj)) {
                        var type = "text";
                        var placeholder = "";
                        var value = "";
                        var extraAttr = "";
                        var required = "";
                        var label = "";

                        if(Centauri.isNotUndefined(inputObj.type)) {
                            type = inputObj.type;
                        }

                        if(Centauri.isNotUndefined(inputObj.placeholder)) {
                            placeholder = inputObj.placeholder;
                        }

                        if(Centauri.isNotUndefined(inputObj.value)) {
                            value = inputObj.value;
                        }

                        if(Centauri.isNotUndefined(inputObj.extraAttr)) {
                            extraAttr = " " + inputObj.extraAttr;
                        }

                        if(Centauri.isNotUndefined(inputObj.required)) {
                            if(inputObj.required) {
                                required = " required";
                            }
                        }

                        if(Centauri.isNotUndefined(inputObj.label)) {
                            var activeClass = "";

                            if(value.length != 0) {
                                activeClass = " class='active'";
                            }

                            label = "<label for='" + inputObj.id + "'" + activeClass + ">" + inputObj.label + "</label>";
                        }

                        var html = "<div class='md-form'><input class='form-control' type='" + type + "' placeholder='" + placeholder + "' value='" + value + "' id='" + inputObj.id + "'" + extraAttr + required + " />" + label + "</div>";

                        if(type == "custom") {
                            html = Centauri.Utility.EditorUtility.getCustomHTMLByType(inputObj);
                        }

                        $("form", $editor).append(html);
                    }
                });

                $("form .mdb-select", $editor).materialSelect();
                Centauri.Utility.EditorUtility.Validator();
                Centauri.Listeners.EditorListener();
            }
        }

        if(Centauri.isNotUndefined(data.container)) {
            Centauri.Components.EditorComponent.Container = data.container;

            if(Centauri.isNotUndefined(data.cols)) {
                $(".bottom", $editor).append("<div class='" + data.container + "'><div class='row'></div></div>");
                $row = $("> .bottom > .container > .row", $editor);

                $.each(data.cols, function(index, colObj) {
                    var col = "col";

                    if(Centauri.isNotUndefined(colObj.size)) {
                        col = "col-" + colObj.size;
                    }

                    $row.append("<div class='" + col + "'>" + colObj.html + "</div>");
                });
            } else if(!$editor.find(".bottom ." + data.container).length) {
                $(".bottom", $editor).append("<div class='" + data.container + "'></div>");
            }
        }

        if(!Centauri.Components.EditorComponent.ButtonsInitialized) {
            Centauri.Components.EditorComponent.ButtonsInitialized = true;

            $("button[data-id='save']", $editor).on("click", function() {
                var formValErr = false;
                var $inputs = $("input.error", $editor);

                $inputs.each(function() {
                    var $input = $(this);

                    if(!$input.parent().hasClass("mdb-select")) {
                        formValErr = true;
                        return;
                    }
                });

                if(Centauri.elExists($("input.error:not(.select-dropdown)", $editor)) || formValErr) {
                    Centauri.Notify("error", "Form Validation", "Please fill out all fields!");
                } else {
                    var formData = [];

                    $("form input", $editor).each(function() {
                        var id = $(this).attr("id");

                        if(Centauri.isNotUndefined(id)) {
                            var value = $(this).val();
                            formData[id] = value;
                        }
                    });

                    data.callbacks.save(formData);

                    if(Centauri.isNotUndefined(data.loadModuleAfterSaved)) {
                        Centauri.Components.ModulesComponent({
                            type: "load",
                            module: data.loadModuleAfterSaved
                        });
                    }
                }
            });

            $("button[data-id='cancel']", $editor).on("click", function() {
                Centauri.Components.EditorComponent("hide");

                $(".overlayer").addClass("hidden");

                var closer = $(".overlayer").attr("data-closer");
                Centauri.Events.OnOverlayerHiddenEvent(closer);
                Centauri.Events.OnEditorComponentClosedEvent();

                setTimeout(function() {
                    Centauri.Components.EditorComponent("clear", {
                        forceClear: Centauri.Components.EditorComponent.ClearOnClose
                    });
                }, Centauri.Components.EditorComponent.TransitionTime);

                if(Centauri.isNotUndefined(data.callbacks.cancel)) {
                    data.callbacks.cancel();
                }
            });
        }

        if(Centauri.isNotUndefined(data.callbacks.beforeLoaded)) {
            data.callbacks.beforeLoaded($editor);
        }

        $editor.addClass("active");
        setTimeout(function() {
            $(".overlayer").removeClass("hidden");
            $(".overlayer").attr("data-closer", "EditorComponent");

            if(Centauri.isNotUndefined(data.callbacks.loaded)) {
                data.callbacks.loaded($("." + Centauri.Components.EditorComponent.Container, $editor), (crtID == id));
            }
        }, Centauri.Components.EditorComponent.TransitionTime);

        Centauri.Components.EditorComponent.init();
    }

    if(type == "hide") {
        $editor.removeClass("active");

        setTimeout(function() {
            $(".overlayer").addClass("hidden");
            $(".overlayer").removeAttr("data-closer");
        }, Centauri.Components.EditorComponent.TransitionTime);
    }

    if(type == "clear") {
        if(
            Centauri.Components.EditorComponent.ClearOnClose
        ||
            (Centauri.isNotUndefined(data) && data.forceClear)
        ) {
            $("form", $editor).empty();
            $editor.removeAttr("data-id");
        }

        $editor.removeClass(Centauri.Components.EditorComponent.Size);

        $("button[data-id]", $editor).off();
        Centauri.Components.EditorComponent.ButtonsInitialized = false;
        Centauri.Components.EditorComponent.FormData = null;

        if(Centauri.Components.EditorComponent.Container) {
            Centauri.Components.EditorComponent.Container = "undefined";

            if(Centauri.Components.EditorComponent.ClearOnClose) {
                $(".bottom > .container", $editor).remove();
            }
        }
    }
};

Centauri.Components.EditorComponent.init = function() {
    $(".overlayer").on("click", this, function() {
        var closer = $(this).attr("data-closer");

        if(closer == "EditorComponent") {
            setTimeout(function() {
                Centauri.Components.EditorComponent("clear", {
                    forceClear: true
                });
            }, Centauri.Components.EditorComponent.TransitionTime);

            Centauri.Events.OnOverlayerHiddenEvent(closer);
            Centauri.Events.OnEditorComponentClosedEvent();
        }
    });

    $(document).on("keyup", function(e) {
        if(e.which == 27) {
            var closer = $(".overlayer").attr("data-closer");

            if(closer == "EditorComponent") {
                Centauri.Components.EditorComponent("hide");

                setTimeout(function() {
                    Centauri.Components.EditorComponent("clear", {
                        forceClear: true
                    });
                }, Centauri.Components.EditorComponent.TransitionTime);

                Centauri.Events.OnOverlayerHiddenEvent(closer);
                Centauri.Events.OnEditorComponentClosedEvent();
            }
        }
    });
};

Centauri.Components.EditorComponent.TransitionTime = 660;
Centauri.Components.EditorComponent.Size = null;
Centauri.Components.EditorComponent.Container = "undefined";
Centauri.Components.EditorComponent.ButtonsInitialized = false;
Centauri.Components.EditorComponent.ClearOnClose = true;
Centauri.Components.EditorComponent.FormData = null;

Centauri.Components.ModulesComponent = function(data) {
    if(data.type == "init") {
        $("#dashboard #modules .module").each(function() {
            $module = $(this);

            $module.on("click", function() {
                $(".overlayer").removeClass("hidden");

                $module = $(this);
                var moduleID = $module.data("module-id");

                Centauri.fn.Ajax(
                    "Modules",
                    "show",

                    {
                        moduleid: moduleID
                    },

                    {
                        success: function(data) {
                            $("#dashboard #modules .module.active").removeClass("active");
                            $module.addClass("active");

                            $(".overlayer").addClass("hidden");
                            $("#content").html(data);

                            var title = $.trim($("#content").find("#title").text());
                            Centauri.Utility.UpdateHeadTags([
                                ["title", title]
                            ]);

                            Centauri.Events.OnModuleLoadEvent(moduleID);
                        },

                        error: function(data) {
                            $(".overlayer").addClass("hidden");
                            console.error(data);
                        }
                    }
                );
            });
        });

        setTimeout(function() {
            if(Centauri.elExists($("#dashboard #modules .module.active"))) {
                $("#dashboard #modules .module.active").trigger("click");
            } else {
                $("#dashboard #modules .module[data-module-id='" + Centauri.defaultModule + "']").trigger("click");
            }
        }, 333);

        $("#dashboard #user i").on("click", function() {
            $("#dashboard #user").toggleClass("active");
            $("#dashboard #user .dropdown-view").slideToggle();
        });
    }

    if(data.type == "load") {
        var module = data.module;

        Centauri.fn.Ajax(
            "Modules",
            "show",

            {
                moduleid: module
            },

            {
                success: function(data) {
                    $(".overlayer").addClass("hidden");
                    $("#content").html(data);

                    var title = $.trim($("#content").find("#title").text());
                    Centauri.Utility.UpdateHeadTags([
                        ["title", title]
                    ]);

                    Centauri.Events.OnModuleLoadEvent(module);

                    Centauri.DAPLoader.historyPushState = true;
                },

                error: function(data) {
                    $(".overlayer").addClass("hidden");
                    console.error(data);
                }
            }
        );
    }
};

Centauri.Components.PagesComponent = function(module) {
    if(module == "pages") {
        $action = $("table#pages .actions .action");

        $action.on("click", function() {
            $tr = $(this).parent().parent().parent();

            Centauri.Components.PagesComponent.uid = $(this).attr("data-uid");
            var action = $(this).attr("data-action");

            var title = $.trim($("td[data-type='title']", $tr).text());
            var lid = $.trim($("td[data-type='lid']", $tr).attr("data-lid"));
            var flagsrc = $.trim($("td[data-type='lid'] img", $tr).attr("src"));
            var url = $.trim($("td[data-type='url']", $tr).text());
            var created_at = $.trim($("td[data-type='created_at']", $tr).text());
            var updated_at = $.trim($("td[data-type='updated_at']", $tr).text());

            if(action == "page-edit") {
                Centauri.Components.EditorComponent("show", {
                    id: "EditPage-" + Centauri.Components.PagesComponent.uid,
                    title: "Page-Editor - Edit",

                    form: [
                        {
                            id: "uid",
                            label: "UID",
                            type: "text",
                            value: Centauri.Components.PagesComponent.uid,
                            extraAttr: "disabled"
                        },

                        {
                            id: "language",
                            type: "custom",
                            custom: "image",

                            data: {
                                label: "Language",
                                src: flagsrc
                            }
                        },

                        {
                            id: "title",
                            label: "Title",
                            type: "text",
                            value: title,
                            required: true
                        },

                        {
                            id: "url",
                            label: "URL",
                            type: "text",
                            value: url,
                            required: true
                        },

                        {
                            id: "created_at",
                            label: "Created at",
                            type: "text",
                            value: created_at,
                            extraAttr: "disabled"
                        },

                        {
                            id: "updated_at",
                            label: "Updated at",
                            type: "text",
                            value: updated_at,
                            extraAttr: "disabled"
                        }
                    ],

                    callbacks: {
                        save: function(formData) {
                            var id = $("#editor").attr("data-id");

                            Centauri.fn.Ajax(
                                "Page",
                                "editPage",

                                {
                                    uid: Centauri.Components.PagesComponent.uid,
                                    title: formData.title,
                                    url: formData.url
                                },

                                {
                                    success: function(data) {
                                        data = JSON.parse(data);
                                        Centauri.Notify(data.type, data.title, data.description);

                                        Centauri.Components.EditorComponent("clear");
                                        Centauri.Components.EditorComponent("hide");

                                        Centauri.Components.ModulesComponent({
                                            type: "load",
                                            module: "pages"
                                        });
                                    },

                                    error: function(data) {
                                        console.error(data);
                                    }
                                }
                            );
                        }
                    }
                });
            }

            if(action == "page-contentelement-edit") {
                var container = "container";

                Centauri.Components.EditorComponent("show", {
                    id: "EditPageContentElement-" + lid + "-" + Centauri.Components.PagesComponent.uid,
                    title: "<img src='" + flagsrc + "' class='img-fluid' style='width: 40px; margin-right: 10px;' /> Page: " + title + " - Content-Element Editor",

                    size: "fluid",
                    container: container,

                    callbacks: {
                        loaded: function($container, exists) {
                            if(!exists) {
                                Centauri.fn.Ajax.Overlayer = false;

                                Centauri.fn.Ajax(
                                    "ContentElements",
                                    "findByPid",

                                    {
                                        pid: Centauri.Components.PagesComponent.uid
                                    },

                                    {
                                        success: function(data) {
                                            Centauri.fn.Ajax.Overlayer = true;

                                            var $container = $("#editor > .bottom > .container");
                                            $container.html(data);

                                            /**
                                             * Initializing drag-drop for the elements so they can be moved
                                             */
                                            Centauri.Helper.PagesHelper();

                                            /**
                                             * Registering click-event for newCEButton
                                             */
                                            Centauri.Modal.NewContentElementModal();

                                            var $tops = $(".top", $container);
                                            $tops.each(function() {
                                                var $top = $(this);

                                                $(".edit", $top).on("click", function() {
                                                    var $top = $(this).parent();
                                                    $top.parent().toggleClass("active");

                                                    if(!Centauri.elExists($top.parent().find(".fields"))) {
                                                        Centauri.fn.Ajax(
                                                            "ContentElements",
                                                            "findFieldsByUid",

                                                            {
                                                                uid: $top.parent().attr("data-uid")
                                                            },

                                                            {
                                                                success: function(data) {
                                                                    $top.parent().append(data);

                                                                    /**
                                                                     * Initializing CKEditor 5
                                                                     */
                                                                    Centauri.Helper.NewContentElementHelper();

                                                                    $(".fields button").on("click", function() {
                                                                        var uid = $(this).parent().parent().parent().parent().data("uid");
                                                                        var trigger = $(this).data("trigger");

                                                                        if(trigger == "hideElementByUid") {
                                                                            $(this).toggleClass("btn-primary btn-info");
                                                                            $("i", $(this)).toggleClass("fa-eye fa-eye-slash");

                                                                            Centauri.fn.Ajax(
                                                                                "ContentElements",
                                                                                "hideElementByUid",

                                                                                {
                                                                                    uid: uid
                                                                                },

                                                                                {
                                                                                    success: function(data) {
                                                                                        console.log(data);
                                                                                    },

                                                                                    error: function(data) {
                                                                                        console.error(data);
                                                                                    }
                                                                                }
                                                                            )
                                                                        }
                                                                    });

                                                                    $(".fields", $top.parent()).slideDown();
                                                                },

                                                                error: function(data) {
                                                                    console.error(data);
                                                                }
                                                            }
                                                        );
                                                    } else {
                                                        $fields = $top.parent().find(".fields");
                                                        $fields.slideToggle();
                                                    }
                                                });
                                            });
                                        }
                                    }
                                );
                            }
                        },

                        save: function() {
                            console.log("save mal");
                        }
                    }
                });
            }

            if(action == "page-show") {
                Centauri.fn.Ajax(
                    "Page",
                    "showPage",

                    {
                        uid: Centauri.Components.PagesComponent.uid
                    },

                    {
                        success: function(data) {
                            if(data == "/") {
                                data = Centauri.Utility.PathsUtility.root;
                            } else {
                                if(data[0] == "/") {
                                    data = data.substring(1, data.length);
                                }

                                data = Centauri.Utility.PathsUtility.root + data;
                            }

                            window.open(data);
                        },

                        error: function(data) {
                            console.error(data);
                        }
                    }
                );
            }

            if(action == "page-delete") {
                Centauri.fn.Modal(
                    "Delete this page",
                    "Are you sure to continue deleting this page with all its content?",

                    {
                        close: {
                            label: "Cancel",
                            class: "warning"
                        },

                        save: {
                            label: "Delete",
                            class: "danger"
                        }
                    },

                    {
                        save() {
                            Centauri.fn.Ajax(
                                "Page",
                                "deletePage",

                                {
                                    uid: Centauri.Components.PagesComponent.uid
                                },

                                {
                                    success: function(data) {
                                        data = JSON.parse(data);
                                        if(Centauri.isNotUndefined(data.request)) {
                                            Centauri.Notify("error", "An error occurred!", "Please contact an administrator to handle this internal error.\nError: " + data.request, {
                                                timeOut: -1
                                            });
                                        } else {
                                            Centauri.Notify(data.type, data.title, data.description);
                                        }

                                        Centauri.Components.ModulesComponent({
                                            type: "load",
                                            module: "pages"
                                        });
                                    },

                                    error: function(data) {
                                        console.error(data);
                                    }
                                }
                            );
                        }
                    }
                );
            }

            if(action == "page-translations") {
                Centauri.fn.Ajax(
                    "Page",
                    "getTranslateableLanguages",

                    {
                        uid: Centauri.Components.PagesComponent.uid
                    },

                    {
                        success: function(data) {
                            data = JSON.parse(data);
                            var languages = data;

                            Centauri.Components.EditorComponent("show", {
                                id: "TranslatePage-" + Centauri.Components.PagesComponent.uid,
                                title: "Page-Editor - Translation",

                                form: [
                                    {
                                        id: "language",
                                        type: "custom",
                                        custom: "select",

                                        data: {
                                            label: "Language",
                                            options: languages
                                        }
                                    },

                                    {
                                        id: "copyelements",
                                        type: "custom",
                                        custom: "checkbox",

                                        data: {
                                            label: "Copy elements?",
                                            isChecked: true
                                        }
                                    },

                                    {
                                        id: "title",
                                        label: "Title",
                                        type: "text",
                                        value: title,
                                        required: true
                                    },

                                    {
                                        id: "url",
                                        label: "URL",
                                        type: "text",
                                        value: url,
                                        required: true
                                    }
                                ],

                                callbacks: {
                                    save: function() {
                                        var lid = $("#language", $editor).val();
                                        var title = $("#title", $editor).val();
                                        var url = $("#url", $editor).val();

                                        Centauri.fn.Ajax(
                                            "Page",
                                            "createTranslatedPage",

                                            {
                                                uid: Centauri.Components.PagesComponent.uid,
                                                lid: lid,
                                                title: title,
                                                url: url
                                            },

                                            {
                                                success: function(data) {
                                                    console.log(data);
                                                },

                                                error: function(data) {
                                                    console.error(data);
                                                }
                                            }
                                        );
                                    }
                                }
                            });
                        },

                        error: function(data) {
                            console.error(data);
                        }
                    }
                );
            }
        });
    }

    else if(module == "languages") {
        $action = $("table#languages .actions .action");

        $action.on("click", function() {
            $tr = $(this).parent().parent().parent();

            Centauri.Components.PagesComponent.uid = $(this).attr("data-uid");
            var action = $(this).attr("data-action");

            var title = $.trim($("td[data-type='title']", $tr).text());

            if(action == "language-delete") {
                Centauri.fn.Modal(
                    "Delete " + title + " language",
                    "Are you sure to continue deleting the language '" + title + "' with all its bounded content?",

                    {
                        close: {
                            label: "Cancel",
                            class: "warning"
                        },

                        save: {
                            label: "Delete",
                            class: "danger"
                        }
                    },

                    {
                        save() {
                            Centauri.fn.Ajax(
                                "Language",
                                "deleteLanguage",

                                {
                                    uid: Centauri.Components.PagesComponent.uid
                                },

                                {
                                    success: function(data) {
                                        data = JSON.parse(data);
                                        Centauri.Notify(data.type, data.title, data.description);

                                        Centauri.Components.ModulesComponent({
                                            type: "load",
                                            module: "languages"
                                        });
                                    },

                                    error: function(data) {
                                        console.error(data);
                                    }
                                }
                            );
                        }
                    }
                );
            }
        });
    }
};

