/**
 * Centauri HPL - DynamicAjaxPopstate Loader
 */
Centauri.DAPLoader = function() {
    var url = location.origin + Centauri.Utility.PathsUtility.root + "centauri";

    window.onpopstate = function() {
        var moduleid = location.href.replace(url, "");
            moduleid = moduleid.replace("/", "");

        Centauri.DAPLoader.historyPushState = false;

        Centauri.Components.ModulesComponent({
            type: "load",
            module: moduleid
        });
    };
};

Centauri.DAPLoader.historyPushState = true;

Centauri.Events.OnBackendEvent = function() {
    Centauri.load();
};

Centauri.Events.OnEditorComponentClosedEvent = function() {
    setTimeout(function() {
        Centauri.Components.EditorComponent("clear");
    }, 660);
};

Centauri.Events.OnModuleLoadEvent = function(module) {
    Centauri.Module = module;
    Centauri.Components.PagesComponent(module);

    if(Centauri.DAPLoader.historyPushState) {
        history.pushState({page: 1}, module, Centauri.Utility.PathsUtility.root + "centauri/" + module);
    }

    if(module == "dashboard") {}

    else if(module == "pages") {
        $("table#pages tr").on("dblclick", this, function() {
            $(".actions .action[data-action='page-edit']", $(this)).trigger("click");
        });

        $("#pagemodule_buttons button").each(function() {
            $button = $(this);

            $button.on("click", this, function() {
                var btnType = $(this).data("button-type");

                if(btnType == "refresh") {
                    Centauri.Components.ModulesComponent({
                        type: "load",
                        module: "pages"
                    });
                }

                if(btnType == "create") {
                    Centauri.fn.Ajax(
                        "Page",
                        "getRootPages",

                        {},

                        {
                            success: function(data) {
                                data = JSON.parse(data);
                                var rootpages = data;

                                Centauri.fn.Ajax(
                                    "Page",
                                    "getLanguages",

                                    {},

                                    {
                                        success: function(data) {
                                            data = JSON.parse(data);
                                            var languages = data;

                                            Centauri.Components.EditorComponent("show", {
                                                id: "CreateNewPage",
                                                title: "Page-Editor - New",

                                                form: [
                                                    {
                                                        id: "parent",
                                                        type: "custom",
                                                        custom: "select",

                                                        data: {
                                                            label: "Parent Page",
                                                            options: rootpages
                                                        }
                                                    },

                                                    {
                                                        id: "language",
                                                        type: "custom",
                                                        custom: "select",
                                                        extraAttr: "style='display: none!important;'",

                                                        data: {
                                                            label: "Languages",
                                                            options: languages
                                                        }
                                                    },

                                                    {
                                                        id: "title",
                                                        type: "text",
                                                        label: "Title",
                                                        required: true
                                                    },

                                                    {
                                                        id: "url",
                                                        type: "text",
                                                        label: "URL",
                                                        required: true
                                                    },

                                                    {
                                                        id: "is_rootpage",
                                                        type: "custom",
                                                        custom: "switch",

                                                        data: {
                                                            label: "Root page?",
                                                            isChecked: false,
                                                            onClick: "Centauri.Events.EditorComponent.Checkbox.OnClick(this)"
                                                        }
                                                    }
                                                ],

                                                callbacks: {
                                                    loadModuleAfterSaved: "languages",

                                                    beforeLoaded: function($editor) {
                                                        if(rootpages.length == 0) {
                                                            $("#is_rootpage", $editor).prop("checked", true);
                                                            $("#is_rootpage", $editor).attr("disabled", " ");
                                                            $("form .field #language", $editor).parent().parent().removeAttr("style");
                                                            $("form .field #parent", $editor).parent().parent().attr("style", "display: none!important;");
                                                        }
                                                    },

                                                    save: function() {
                                                        Centauri.fn.Ajax.Overlayer = false;

                                                        Centauri.fn.Ajax(
                                                            "Page",
                                                            "newPage",

                                                            {
                                                                parentuid: $("#parent", $editor).val(),
                                                                language: $("#language", $editor).val(),
                                                                isrootpage: $("#is_rootpage", $editor).prop("checked"),
                                                                title: $("#title", $editor).val(),
                                                                url: $("#url", $editor).val()
                                                            },

                                                            {
                                                                success: function(data) {
                                                                    data = JSON.parse(data);
                                                                    Centauri.Notify(data.type, data.title, data.description);

                                                                    Centauri.Components.EditorComponent("clear");
                                                                    Centauri.Components.EditorComponent("hide");

                                                                    Centauri.Components.ModulesComponent({
                                                                        type: "load",
                                                                        module: "pages"
                                                                    });
                                                                },

                                                                error: function(data) {
                                                                    
                                                                },

                                                                complete: function() {
                                                                    Centauri.fn.Ajax.Overlayer = true;
                                                                }
                                                            }
                                                        );
                                                    }//,cancel: function() {}
                                                }
                                            });
                                        },

                                        error: function(data) {
                                            console.error(data);
                                        }
                                    }
                                );
                            }
                        }
                    );
                }
            });
        });
    }

    else if(module == "languages") {
        $("#languagemodule_buttons button").each(function() {
            $button = $(this);

            $button.on("click", this, function() {
                var btnType = $(this).data("button-type");

                if(btnType == "create") {
                    Centauri.Components.EditorComponent("show", {
                        id: "CreateNewPage",
                        title: "Language-Editor - New",

                        form: [
                            {
                                id: "title",
                                type: "text",
                                label: "Title",
                                required: true
                            },

                            {
                                id: "langcode",
                                type: "text",
                                label: "Lang-Code",
                                required: true
                            },

                            {
                                id: "slug",
                                type: "text",
                                label: "Slug",
                                required: true
                            }
                        ],

                        callbacks: {
                            loadModuleAfterSaved: "languages",

                            save: function(data) {
                                Centauri.fn.Ajax(
                                    "Language",
                                    "newLanguage",

                                    {
                                        title: data.title,
                                        langcode: data.langcode,
                                        slug: data.slug
                                    },

                                    {
                                        success: function(data) {
                                            data = JSON.parse(data);
                                            Centauri.Notify(data.type, data.title, data.description);

                                            Centauri.Components.ModulesComponent({
                                                type: "load",
                                                module: "languages"
                                            });
                                        },

                                        error: function(data) {
                                            console.error(data);
                                        }
                                    }
                                );
                            }
                        }
                    });
                }

                if(btnType == "refresh") {
                    Centauri.Components.ModulesComponent({
                        type: "load",
                        module: "languages"
                    });
                }
            });
        });

    } else {
        console.error("Centauri.Events.OnModuleLoadEvent: Module '" + module + "' has not been registered with Centauri.Events.OnModuleLoadEvent!");
    }
};

Centauri.Events.OnOverlayerHiddenEvent = function(closer) {
    if(closer == "EditorComponent") {
        Centauri.Components.EditorComponent("hide");
    }
};

Centauri.Helper.NewContentElementHelper = function() {
    if($(".ck.ck-reset_all.ck-body.ck-rounded-corners").length) {
        $(".ck.ck-reset_all.ck-body.ck-rounded-corners").remove();
    }

    var textareas = document.getElementsByClassName("md-textarea");

    for(var i = 0; i < textareas.length; i++) {
        if(!textareas[i].classList.contains("rte-initialized")) {
            textareas[i].classList.add("rte-initialized");

            ClassicEditor.create(textareas[i], {
                toolbar: [
                    'heading',

                    '|',

                    'bold',
                    'italic',
                    'link',

                    'bulletedList',
                    'numberedList',

                    '|',

                    'blockQuote',
                    'imageUpload',
                    'mediaEmbed',

                    '|',

                    'insertTable',

                    '|',

                    'undo',
                    'redo'
                ],

                heading: {
                    options: [
                        { model: 'paragraph', title: 'Paragraph', class: 'ck-heading_paragraph' },
                        { model: 'heading1', view: 'h1', title: 'Heading 1', class: 'ck-heading_heading1' },
                        { model: 'heading2', view: 'h2', title: 'Heading 2', class: 'ck-heading_heading2' },
                        { model: 'heading3', view: 'h3', title: 'Heading 3', class: 'ck-heading_heading3' },
                        { model: 'heading4', view: 'h4', title: 'Heading 4', class: 'ck-heading_heading4' }
                    ]
                }
            }).catch(error => {
                console.error(error);
            });
        }
    }
};

Centauri.Helper.PagesHelper = function() {
    $(".content-element").draggable({
        // containment: "parent",
        revert: "invalid",

        stop: function() {
            $(this).draggable("option", "revert", "invalid");
        }
    });

    $(".content-element").droppable({
        greedy: true,
        tolerance: "touch",

        drop: function(event, ui) {
            ui.draggable.draggable("option", "revert", true);
        }
    });

    $(".allowed-pos").droppable({
        hoverClass: "highlight",
        tolerance: "fit"
    });

    $(".content-element").on("dragstart", function() {
        $(this).addClass("dragging");
        $(".allowed-pos").removeClass("hidden");
    });
    
    $(".content-element").on("dragstop", function() {
        $(this).removeClass("dragging");
        $(".allowed-pos").addClass("hidden");
    });
};

