Centauri.Listeners.EditorListener = function() {
    // Avoids event runs multiple time each time EditorListener() function gets called.
    // That's why .off() and after all that applying all .on()-listeners

    $("form .mdb-select", $editor).off();

    $("form .mdb-select", $editor).on("change", this, function() {
        Centauri.Events.EditorComponent.Select.OnChange(this);
    });
};

Centauri.Modal.NewContentElementModal = function() {
    $("button", $editor).on("click", this, function() {
        var action = $(this).data("action");

        if(action == "newContentElement") {
            var rowPos = $(this).parent().parent().attr("data-rowpos");
            var colPos = $(this).parent().attr("data-colpos");
            var sorting = $(this).attr("data-sorting");

            var sorting, $element;
            var insert = $(this).attr("data-insert");

            if(insert == "before") {
                $element = $(this).next();
            }
            if(insert == "after") {
                $element = $(this).next();
            }

            sorting = $element.attr("data-sorting");

            Centauri.fn.Ajax(
                "ContentElements",
                "getConfigCCE",

                {},

                {
                    success: function(data) {
                        Centauri.fn.Modal(
                            "New Content Element",

                            data,

                            {
                                size: "xl",

                                close: {
                                    label: "Clse"
                                },

                                save: {
                                    label: "Create"
                                }
                            },

                            {
                                save: function() {
                                    var datas = [];

                                    $("#modal .element .bottom .md-form > input").each(function() {
                                        var id = $(this).attr("id");

                                        if(Centauri.isNotUndefined(id)) {
                                            var val = $(this).val();

                                            datas.push(
                                                {
                                                    id: id,
                                                    value: val
                                                }
                                            );
                                        }
                                    });

                                    $(".element .bottom .md-form > div.ck-editor").each(function() {
                                        var id = $(this).parent().find("textarea").attr("id");

                                        if(Centauri.isNotUndefined(id)) {
                                            var val = $(".ck-content", $(this)).html();

                                            datas.push(
                                                {
                                                    id: id,
                                                    value: val
                                                }
                                            );
                                        }
                                    });

                                    Centauri.fn.Ajax(
                                        "ContentElements",
                                        "newElement",

                                        {
                                            pid: Centauri.Components.PagesComponent.uid,
                                            ctype: Centauri.Helper.NewContentElementHelper.Element.data("ctype"),
                                            datas: JSON.stringify(datas),

                                            rowPos: rowPos,
                                            colPos: colPos,
                                            insert: insert,
                                            sorting: sorting
                                        },

                                        {
                                            success: function(data) {
                                                data = JSON.parse(data);
                                                Centauri.Notify(data.type, data.title, data.description);

                                                Centauri.fn.Ajax(
                                                    "ContentElements",
                                                    "findByPid",

                                                    {
                                                        pid: Centauri.Components.PagesComponent.uid
                                                    },

                                                    {
                                                        success: function(data) {
                                                            var $container = $("#editor > .bottom > .container");
                                                            $container.html(data);

                                                            /**
                                                             * Registering click-event for newCEButton
                                                             */
                                                            Centauri.Modal.NewContentElementModal();

                                                            /**
                                                             * Initializing CKEditor 5
                                                             */
                                                            Centauri.Helper.NewContentElementHelper();

                                                            var $tops = $(".top", $container);
                                                            $tops.each(function() {
                                                                var $top = $(this);

                                                                $top.on("click", function() {
                                                                    $top = $(this);
                                                                    $top.parent().toggleClass("active");

                                                                    if(!$top.hasClass("toggling")) {
                                                                        $top.addClass("toggling");

                                                                        $fields = $top.parent().find(".fields");
                                                                        $fields.slideToggle(function() {
                                                                            $top.removeClass("toggling");
                                                                        });
                                                                    }
                                                                });
                                                            });
                                                        }
                                                    }
                                                );
                                            },

                                            error: function(data) {
                                                console.error(data);
                                            }
                                        }
                                    );
                                }
                            }
                        );

                        $("#modal .md-form label").on("click", function(e) {
                            e.preventDefault();
                            $(this).parent().find("input").focus();
                        });

                        /**
                         * Initializing CKEditor 5
                         */
                        Centauri.Helper.NewContentElementHelper();

                        /**
                         * Label focus fix for elements
                         */
                        $(".element").each(function() {
                            $(".top", $(this)).on("click", function() {
                                Centauri.Helper.NewContentElementHelper.Element = $(this).parent();
                                $(this).parent().find(".bottom").slideToggle();
                            });
                        });
                    }
                }
            );
        }
    });
};

Centauri.Helper.NewContentElementHelper.Element = null;

Centauri.fn.Ajax = function(ajax, method, data, callbacks, options) {
    var url = Centauri.Utility.PathsUtility.root + Centauri.Utility.PathsUtility.centauri + Centauri.Utility.PathsUtility.ajax + ajax + "/" + method;

    if(Centauri.fn.Ajax.Overlayer) {
        $("#maincontent .overlayer").removeClass("hidden");
        $("#maincontent .overlayer .loader").removeClass("hidden");
    }

    $.ajax({
        url: url,
        type: "POST",

        data: data,

        success: function(data) {
            if(Centauri.isNotUndefined(options)) {
                if(
                    Centauri.isNotUndefined(options.closeEditorComponentOnSuccess)
                &&
                    (options.closeEditorComponentOnSuccess)
                ) {
                    Centauri.Components.EditorComponent("hide");

                    if(Centauri.Components.EditorComponent.ClearOnSave) {
                        setTimeout(function() {
                            Centauri.Components.EditorComponent("clear", {
                                forceClear: true
                            });
                        }, Centauri.Components.EditorComponent.TransitionTime);
                    }
                }
            }

            if(Centauri.fn.Ajax.Overlayer) {
                $("#maincontent .overlayer").addClass("hidden");
                $("#maincontent .overlayer .loader").addClass("hidden");
            }

            callbacks.success(data);
        },

        error: function(data) {
            if(Centauri.fn.Ajax.Overlayer) {
                $("#maincontent .overlayer .loader").addClass("hidden");
            }

            if(Centauri.isNotUndefined(callbacks.error)) {
                callbacks.error(data);
            } else {
                console.error(data);
            }
        },

        complete: function(data) {
            if(Centauri.isNotUndefined(callbacks.complete)) {
                callbacks.complete(data);
            }
        }
    });
};

Centauri.Utility.Ajax = function() {
    Centauri.fn.Ajax.Overlayer = true;

    $.ajaxSetup({
        headers: {
            "X-CSRF-TOKEN": $("meta[name='csrf-token']").attr("content")
        }
    });
};

window.onload = function() {
    Centauri.Utility.Ajax();

    $(document).ajaxError(function(event, jqxhr, settings, thrownError) {
        if(thrownError == "Internal Server Error") {
            Centauri.Notify("error", thrownError, jqxhr.responseText);
        }
    });
};

Centauri.Utility.EditorUtility = {};

Centauri.Utility.ModalUtility = function(title, description, options, callbacks) {
    var html = "";
    var addHTMLFn = Centauri.Utility.ModalUtility.addHTML;

    var modalSize = "";
    var closeclass = "danger";
    var saveclass = "success";

    if(Centauri.isNotUndefined(options)) {
        if(Centauri.isNotUndefined(options.size)) {
            modalSize = " modal-" + options.size;
        }

        if(Centauri.isNotUndefined(options.close.class)) {
            closeclass = options.close.class;
        }

        if(Centauri.isNotUndefined(options.save.class)) {
            saveclass = options.save.class;
        }
    }

    html = "<div class='modal fade' id='modal' tabindex='-1' role='dialog' aria-labelledby='modallabel' aria-hidden='true'>|</div>";
    html = addHTMLFn(html, "<div class='modal-dialog" + modalSize + "' role='document'>|</div>");
    html = addHTMLFn(html, "<div class='modal-content'>|</div>");
    html = addHTMLFn(html, "<div class='modal-header'>|</div>&&");
    html = addHTMLFn(html, "<h5 class='modal-title' id='modallabel'>" + title + "</h5>|");
    html = addHTMLFn(html, "<button type='button' class='close' data-type='close' aria-label='Close'>|</button>");
    html = addHTMLFn(html, "<span aria-hidden='true'>&times;</span>");
    html = addHTMLFn(html, "<div class='modal-body'>" + description + "</div>&&", "&&");
    html = addHTMLFn(html, "<div class='modal-footer'>|</div>", "&&");
    html = addHTMLFn(html, "<button type='button' data-type='close' class='btn btn-" + closeclass + " waves-effect waves-light'>" + options.close.label + "</button>&&");
    html = addHTMLFn(html, "<button type='button' data-type='save' class='btn btn-" + saveclass + " waves-effect waves-light'>" + options.save.label + "</button>", "&&");

    $("body").append(html);
    $("#modal").modal();

    $("#modal").on("hidden.bs.modal", function(e) {
        $("#modal").modal("dispose");
        $(this).remove();
    });

    $("#modal button").on("click", this, function() {
        var btntype = $(this).data("type");
        $("#modal").modal("hide");

        if(btntype == "close") {
            if(Centauri.isNotUndefined(callbacks.close)) {
                callbacks.close();
            }
        }

        if(btntype == "save") {
            callbacks.save();
        }
    });
};

Centauri.Utility.ModalUtility.addHTML = function(crtHTML, html, split = "|") {
    return (crtHTML.split(split).join(html));
};


/**
 * Example Usage:
 * > Centauri.fn.Modal("Hello...", "...world!", {close: {label: "CLOOOSE"}, save: {label: "SAAAAVE"}}, {size: "lg"});
 */
Centauri.fn.Modal = function(title, description, options, callbacks) {
    return Centauri.Utility.ModalUtility(title, description, options, callbacks);
};

